import { Route, Routes } from 'react-router-dom';
import './App.css';
import HomePage from './Components/Navbar';
import Register from './Components/Register';

function App() {
  return (
    <div className="App">
<HomePage/>
<Register/>
<Routes>
  <Route  path='/signIn' element={<Register/>} ></Route>
</Routes>

    </div>
  );
}

export default App;
